import {useState, useEffect} from 'react';

const useFetch = (url) => {
    const [data, setData] = useState(null);

    useEffect(()=>{
        fetch(url)
            .then((res) => console.log("res",res));
    }, [url]);

    return [data];
}

export default useFetch;
